import { useState } from "react";
import { Link } from "react-router-dom/cjs/react-router-dom.min";

const Login = () => {

    const [email,setEmail] = useState('');
    const [password,setPassword] = useState('');

    const handleLoginSubmit = (e) => {
        e.preventDefault();
        // console.log("login Button");        


    }

    return (

        <div>
            <p>Login</p>
            <div className="home-login">
                <form className="homelogin-form" onSubmit={handleLoginSubmit}>
                    <input type="email" value={email} onChange={() => setEmail(e.target.value)} placeholder="Enter Email" required className="homelogin-inputs"></input>
                    <input type="password" value={password} onChange={() => setPassword(e.target.value)} placeholder="Enter Password" required className="homelogin-inputs"></input>
                    <button className="homelogin-submit">Login</button>
                </form>
            </div>
        </div>
    );
}

export default Login;
